import React,{useState} from 'react'


const Signup = () =>{

    return(
        <div>
            <p>Create an account!</p>
             <form>
                <label for="">Username</label>
                <input type="text"></input>
                
                <label for="">Password</label>
                <input type="text"></input>

                <button type="button">LOGIN</button>
            </form>
        </div>
    )
}

export default Signup;
